02:13','','logo-1.jpg','','inherit','open','closed','','logo-1-jpg','','','2019-01-16 13:02:13','2019-01-16 13:02:13','','0','https://themehunk.com/wp-themes/almaira-shop-light-scheme/wp-content/uploads/sites/87/2019/01/logo-1.jpg','0','attachment','image/jpeg','0'), ('70','1','2020-12-20 20:13:08','2020-12-20 12:13:08','<!-- wp:paragraph -->\n<p>这是示范页面。页面和博客文章不同，它的位置是固定的，通常会在站点导航栏显示。很多用户都创建一个“关于”页面，向访客介绍自己。例如：</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>欢迎！我白天是个邮递员，晚上就是个有抱负的演员。这是我的网站。我住在天朝的帝都，有条叫做Jack的狗。</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>……或这个：</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>XYZ Doohickey公司成立于1971年，自从建立以来，我们一直向社会贡献着优秀doohickies。我们的公司总部位于天朝魔都，有着超过两千名员工，对魔都政府税收有着巨大贡献。</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>而您，作为一位WordPress新用户，我们建议您访问<a href=\"http://127.0.0.1/wp-admin/\">您网站的仪表盘</a>，删除本页面，然后创建包含您自己内容的新页面。祝您使用愉快！</p>\n<!-- /wp:paragraph -->','示例页面','','inherit','closed','closed','','2-revision-v1','','','2020-12-20 20:13:08','2020-12-20 12:13:08','','2','http://192.168.123.85/?p=70','0','revision','','0'), ('71','1','2020-12-20 20:13:08','2020-12-20 12:13:08','<!-- wp:heading --><h2>我们是谁</h2><!-- /wp:heading --><!-- wp:paragraph --><p>我们的站点地址是：http://127.0.0.1。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>我们收集何种及为何收集个人数据</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>评论</h3><!-- /wp:heading --><!-- wp:paragraph --><p>当访客留下评论时，我们会收集评论表单所显示的数据，和访客的IP地址及浏览器的user agent字符串来帮助检查垃圾评论。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>由您的电子邮件地址所生成的匿名化字符串（又称为哈希）可能会被提供给Gravatar服务确认您是否有使用该服务。Gravatar服务的隐私政策在此：https://automattic.com/privacy/。在您的评论获批准后，您的资料图片将在您的评论旁公开展示。</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>媒体</h3><!-- /wp:heading --><!-- wp:paragraph --><p>如果您向此网站上传图片，您应当避免上传那些有嵌入地理位置信息（EXIF GPS）的图片。此网站的访客将可以下载并提取此网站的图片中的位置信息。</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>联系表单</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>如果您在我们的站点上留下评论，您可以选择用cookies保存您的姓名、电子邮件地址和网站。这是通过让您可以不用在评论时再次填写相关内容而向您提供方便。这些cookies会保留一年。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>如果您访问我们的登录页，我们会设置一个临时的cookie来确认您的浏览器是否接受cookies。此cookie不包含个人数据，且会在您关闭浏览器时被丢弃。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>当您登录时，我们也会设置多个cookies来保存您的登录信息及屏幕显示选项。登录cookies会保留两天，而屏幕显示选项cookies会保留一年。如果您选择了“记住我”，您的登录会保留两周。如果您注销，登录cookies将被移除。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>如果您编辑或发布文章，我们会在您的浏览器中保存一个额外的cookie。这个cookie不包含个人数据而只记录了您刚才编辑的文章的ID。这个cookie会保留一天。</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>其他站点的嵌入内容</h3><!-- /wp:heading --><!-- wp:paragraph --><p>此站点上的文章可能会包含嵌入的内容（如视频、图像、文章等）。来自其他站点的嵌入内容的行为和您直接访问这些其他站点没有区别。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>这些站点可能会收集关于您的数据、使用cookies、嵌入额外的第三方跟踪程序及监视您与这些嵌入内容的交互，包括在您有这些站点的账户并登录了这些站点时，跟踪您与嵌入内容的交互。</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>统计</h3><!-- /wp:heading --><!-- wp:heading --><h2>我们与谁共享您的信息</h2><!-- /wp:heading --><!-- wp:paragraph --><p>若您请求重置密码，您的IP地址将包含于密码重置邮件中。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>我们保留多久您的信息</h2><!-- /wp:heading --><!-- wp:paragraph --><p>如果您留下评论，评论和其元数据将被无限期保存。我们这样做以便能识别并自动批准任何后续评论，而不用将这些后续评论加入待审队列。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>对于本网站的注册用户，我们也会保存用户在个人资料中提供的个人信息。所有用户可以在任何时候查看、编辑或删除他们的个人信息（除了不能变更用户名外）、站点管理员也可以查看及编辑那些信息。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>您对您的信息有什么权利</h2><!-- /wp:heading --><!-- wp:paragraph --><p>如果您有此站点的账户，或曾经留下评论，您可以请求我们提供我们所拥有的您的个人数据的导出文件，这也包括了所有您提供给我们的数据。您也可以要求我们抹除所有关于您的个人数据。这不包括我们因管理、法规或安全需要而必须保留的数据。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>我们将您的信息发送到哪</h2><!-- /wp:heading --><!-- wp:paragraph --><p>访客评论可能会被自动垃圾评论监测服务检查。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>您的联系信息</h2><!-- /wp:heading --><!-- wp:heading --><h2>其他信息</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>我们如何保护您的数据</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>我们有何种数据泄露处理流程</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>我们从哪些第三方接收数据</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>我们通过用户数据进行何种自动决策及/或归纳</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>行业监管披露要求</h3><!-- /wp:heading -->','隐私政策','','inherit','closed','closed','','3-revision-v1','','','2020-12-20 20:13:08','2020-12-20 12:13:08','','3','http://192.168.123.85/?p=71','0','revision','','0'), ('72','1','2020-12-20 20:16:45','2020-12-20 12:16:45','','One Click Demo Import - log_file_2020-12-20__12-16-45','','inherit','open','closed','','one-click-demo-import-log_file_2020-12-20__12-16-45','','','2020-12-20 20:16:45','2020-12-20 12:16:45','','0','http://192.168.123.85/wp-content/uploads/2020/12/log_file_2020-12-20__12-16-45.txt','0','attachment','text/plain','0'), ('73','1','2019-07-06 06:56:16','2019-07-06 06:56:16','','woocommerce-placeholder','','inherit','open','closed','','woocommerce-placeholder-2','','','2019-07-06 06:56:16','2019-07-06 06:56:16','','0','https://themehunk.com/wp-themes/almaira-shop-light-scheme/wp-content/uploads/sites/87/2019/07/woocommerce-placeholder.png','0','attachment','image/png','0'), ('74','1','2019-01-16 13:02:13','2019-01-16 13:02:13','','pennant-1.jpg','','inherit','open','closed','','pennant-1-jpg','','','2019-01-16 13:02:13','2019-01-16 13:02:13','','0','https://themehunk.com/wp-themes/almaira-shop-light-scheme/wp-content/uploads/sites/87/2019/01/pennant-1.jpg','0','attachment','image/jpeg','0'), ('75','1','2019-07-06 10:12:05','2019-07-06 10:12:05','','Downloads','','publish','closed','closed','','downloads','','','2019-07-06 10:12:05','2019-07-06 10:12:05','','0','https://themehunk.com/wp-themes/almaira-shop-light-scheme/2019/07/06/downloads/','1','nav_menu_item','','0'), ('81','1','2019-07-08 06:07:33','2019-07-08 06:07:33','','hod','','inherit','open','closed','','hod','','','2019-07-08 06:07:33','2019-07-08 06:07:33','','0','