INSERT INTO `sd_wc_admin_notes` VALUES ('1','wc-admin-wc-helper-connection','info','en_US','连接到 WooCommerce.com','连接以获取重要的产品通知和更新。','{}','unactioned','woocommerce-admin','2020-12-20 06:56:56',NULL,'0','plain','','0','info'), ('2','wc-admin-onboarding-email-marketing','info','en_US','提示、产品更新和灵感','我们将竭诚相助 - 将贴心提示、产品更新和灵感直接投递到您的电子邮箱中','{}','unactioned','woocommerce-admin','2020-12-20 06:56:58',NULL,'0','plain','','0','info'), ('3','wc-admin-marketing-intro','info','en_US','与您的受众保持联系','借助专为 WooCommerce 打造的营销工具，扩大您的客户群,增加您的销售额。','{}','unactioned','woocommerce-admin','2020-12-20 06:56:58',NULL,'0','plain','','0','info'), ('4','ecomm-need-help-setting-up-your-store','info','en_US','Need help setting up your Store?','Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.','{}','pending','woocommerce.com','2020-11-30 06:56:58',NULL,'0','plain','','0','info'), ('5','woocommerce-services','info','en_US','WooCommerce Shipping & Tax','WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','{}','pending','woocommerce.com','2020-11-30 06:56:58',NULL,'0','plain','','0','info'), ('6','ecomm-unique-shopping-experience','info','en_US','For a shopping experience as unique as your customers','Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.','{}','pending','woocommerce.com','2020-11-30 06:56:58',NULL,'0','plain','','0','info'), ('7','wcpay-promo-2020-11','marketing','en_US','Manage subscriber payments from your store\'s dashboard','Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>  – now supporting <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>','{}','pending','woocommerce.com','2020-11-30 06:56:58',NULL,'0','plain','','0','info'), ('8','wcpay-subscriptions-2020-11','marketing','en_US','Manage subscriber payments from your store\'s dashboard','Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>  – now supporting <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>','{}','pending','woocommerce.com','2020-11-30 06:56:58',NULL,'0','plain','','0','info'), ('9','wcpay-promo-2020-12','marketing','en_US','Get 50% off transaction fees with WooCommerce Payments','Keep more of your hard-earned cash by adding <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20\" target=\"_blank\">WooCommerce Payments</a> to your store. Lock in a discounted rate of 1.5% + $0.15 for $25,000 of payments (or three months, whichever comes first). Limited time offer – don’t miss out! <br /><br /><em>By clicking \"Install now,\" you agree to our promotional <a href=\"https://woocommerce.com/terms-conditions/woocommerce-payments-promotion/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20\" target=\"_blank\">Terms of Service</a>.</em>','{}','pending','woocommerce.com','2020-11-30 06:56:58',NULL,'0','plain','','0','info'), ('10','wcpay-subscriptions-2020-12','marketing','en_US','Manage payments from your store\'s dashboard','Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>! Zero setup fees or monthly fees. Just pay-as-you-go, starting at just 2.9% + $0.30 per transaction for U.S.-issued cards. <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>','{}','pending','woocommerce.com','2020-11-30 06:56:58',NULL,'0','plain','','0','info'), ('11','wc-admin-draw-attention','info','en_US','如何引起人们对您在线商店的关注','为便于您入门，这里有 7 种方法可以提高您的销售额，避免被争取相同买家的批量生产的类似产品所淹没。','{}','unactioned','woocommerce-admin','2020-12-20 06:58:28',NULL,'0','plain','','0','info'), ('12','storefront-customize','info','en_US','Design your store with Storefront ?','Visit the Storefront settings page to start setup and customization of your shop.','{}','unactioned','storefront','2020-12-20 07:25:04',NULL,'0','plain','','0','info');
